import React, { useState } from "react";
import MapComponent from "./MapComponent"; // Changed import
import Driver from "./driver";
import Book from "./book";

function MapPage() { // Changed function name to MapPage
  const [fare, setFare] = useState(0);
  const [showBooking, setShowBooking] = useState(false);

  return (
    <div>
      <MapComponent setFare={setFare} /> {/* Changed component name */}
      <Driver
        fare={fare}
        onBook={() => setShowBooking(true)}
      />
      {showBooking && <Book fare={fare} />}
    </div>
  );
}

export default MapPage;
